# Idanimọ oju
class Oju:
    def __init__(self, irun, irun_ẹgbẹ):
        self.irun = irun
        self.irun_ẹgbẹ = irun_ẹgbẹ

    def idanimọ(self):
        return f"Oju {self.irun} ni {self.irun_ẹgbẹ}"

# Idanimọ ọdaràn
class Odaràn:
    def __init__(self, irun, irun_ẹgbẹ, idanimọ):
        self.irun = irun
        self.irun_ẹgbẹ = irun_ẹgbẹ
        self.idanimọ = idanimọ

    def idanimọ(self):
        return f"Odaràn {self.irun} ni {self.irun_ẹgbẹ} {self.idanimọ}"

# Idanimọ ije
class Ije:
    def __init__(self, irun, irun_ẹgbẹ, idanimọ):
        self.irun = irun
        self.irun_ẹgbẹ = irun_ẹgbẹ
        self.idanimọ = idanimọ

    def idanimọ(self):
        return f"Ije {self.irun} ni {self.irun_ẹgbẹ} {self.idanimọ}"

# Idanimọ awọn ọdaràn lori ije
class Idanimọ_ọdaràn_lori_ije:
    def __init__(self, oju, odaràn, ije):
        self.oju = oju
        self.odaràn = odaràn
        self.ije = ije

    def idanimọ(self):
        return f"{self.oju.idanimọ()} {self.odaràn.idanimọ()} {self.ije.idanimọ()}"

